import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import LoginSelection from "./LoginSelection";
import UserLogin from "./UserLogin";
import UserRegister from "./UserRegister";
import UserDashboard from "./UserDashboard";
import PersonalizedNews from "./PersonalizedNews";
import AllNews from "./AllNews";
import AdminLogin from "./AdminLogin";
import Dashboard from "./Dashboard";
import AddNews from "./AddNews";
import UpdateNews from "./UpdateNews";
import DeleteNews from "./DeleteNews";

const App = () => {
    return (
        <Router>
            <Routes>
                {/* Main Page with Login Selection */}
                <Route path="/" element={<LoginSelection />} />

                {/* User Routes */}
                <Route path="/user-login" element={<UserLogin />} />
                <Route path="/user-register" element={<UserRegister />} />
                <Route path="/user-dashboard" element={<UserDashboard />} />
                <Route path="/personalized-news" element={<PersonalizedNews />} />
                <Route path="/all-news" element={<AllNews />} />

                {/* Admin Routes */}
                <Route path="/admin-login" element={<AdminLogin />} />
                <Route path="/dashboard" element={<Dashboard />} />
                <Route path="/add-news" element={<AddNews />} />
                <Route path="/update-news" element={<UpdateNews />} />
                <Route path="/delete-news" element={<DeleteNews />} />
            </Routes>
        </Router>
    );
};

export default App;
